import React from "react";
import "../../../Styles/Pages/Home/HomeSixth.scss";

function HomeSixth() {
  return (
    <div className='homeSixth'>
      <h1>What people say about us</h1>
      <div className='homeSixth__row'></div>
    </div>
  );
}

export default HomeSixth;
